import React from "react";

const PostList = props => {
  return (
    <table>
      <thead>
        <tr>
          <th>Post Title</th>
          <th>Body of the post</th>
          <th>Authors data</th>
          <th>Other information</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <Post />
        </tr>
      </tbody>
    </table>
  );
};

export default PostList;
